import axios from 'axios'
import { IdefaultUserValues } from './interfaces'

export const resetUser = async (defaultUserData: IdefaultUserValues) => {
    await axios.post(`${process.env.REACT_APP_ENDPOINT}/API/updateUser`, defaultUserData)
    .then(data => data.data)
}

export const buyCrypto = async (amount: Number, type: string) => {
    await axios.post(`${process.env.REACT_APP_ENDPOINT}/API/buyCrypto`, {amount, name: "admin", type})
    .then(data => data.data)
}

export const sellCrypto = async (amount: Number, type: string) => {
    await axios.post(`${process.env.REACT_APP_ENDPOINT}/API/sellCrypto`, {amount, name: "admin"})
    .then(data => data.data)
}
